import React from 'react'
import { useNavigate } from 'react-router-dom'
function Profile() {
  let navigete = useNavigate();
  return (
    <div>
      This is Profile Page <Button onClick={()=>{navigete('/about')}}>Cheange to about</Button>
    </div>
  )
}

export default Profile
